import React from "react";
import { Upload, Button, Typography } from "antd";
import { UploadOutlined } from "@ant-design/icons";

const { Title } = Typography;

interface UploadPageProps {
  fileList: any[];
  onChange: (info: any) => void;
}

const UploadPage: React.FC<UploadPageProps> = ({ fileList, onChange }) => {
  return (
    <>
      <Title level={4}>1. Upload Document</Title>
      <Upload
        accept=".txt,.pdf,.docx"
        beforeUpload={() => false}
        onChange={onChange}
        fileList={fileList}
      >
        <Button icon={<UploadOutlined />}>Upload .txt, .pdf, or .docx</Button>
      </Upload>
    </>
  );
};

export default UploadPage;
